# interpolation works much faster when values to be interpolated relate to an AbstractUnitRange 
# so create amp values at regularly spaced frequencies, then pass a scaled frequency into the interpolators
# make these frequency ranges common to all amp functions (and deliberately push them beyond typical values provided)
const fii_min_freq = 0.001
const fii_max_freq = 1000.0
const num_lnfii_freqs = 1001
const lnfii_min_freq = log(fii_min_freq)

const f_reg = exp10.(range(log10(fii_min_freq), stop=log10(fii_max_freq), length=num_lnfii_freqs))
const Δlnf_reg = log(fii_max_freq / fii_min_freq) / (num_lnfii_freqs-1)


# Boore (2016) WUS generic rock amplification function (relative to β=3.5km/s and ρ=2.72g/cm^3 source properties) for Vs30 of 760 m/s
const fii_b16_760 = [0.001, 0.010, 0.015, 0.021, 0.031, 0.045, 0.065, 0.095, 0.138, 0.200, 0.291, 0.423, 0.615, 0.894, 1.301, 1.892, 2.751, 4.000, 5.817, 8.459, 12.301, 17.889, 26.014, 37.830, 55.012, 80.000]
const Aii_b16_760 = [1.00, 1.00, 1.01, 1.02, 1.02, 1.04, 1.06, 1.09, 1.13, 1.18, 1.25, 1.32, 1.41, 1.51, 1.64, 1.80, 1.99, 2.18, 2.38, 2.56, 2.75, 2.95, 3.17, 3.42, 3.68, 3.96]
# define initial linear interpolation once using the above irregular grid and extrapolation
itp_b16_760 = linear_interpolation(fii_b16_760, Aii_b16_760, extrapolation_bc=Flat())
# compute the amp function values at the regular (log-spaced) frequencies
Aii_b16_760_reg = itp_b16_760.(f_reg)
# define a new interpolant that is highly efficient and works on the regular-spaced grid
itp_b16_760_reg = interpolate(Aii_b16_760_reg, BSpline(Linear()))

"""
	boore_2016_generic_amplification(f)

Computes the generic crustal amplification for a WUS velocity profile with Vs30 of 760 m/s using the Boore (2016) velocity model.
Uses linear interpolation for frequencies between the publised values, and uses a flat/constant extrapolation outside of this range.

# Examples
```julia-repl
	f = 5.0
	Af = boore_2016_generic_amplification(f)
```
"""
function boore_2016_generic_amplification(f::T; fmin=fii_min_freq, fmax=fii_max_freq, Δlnf=Δlnf_reg) where {T<:Real}
    if isnan(f)
        return NaN * oneunit(T)
    else
        if f <= fmin
            return oneunit(T)
        elseif f >= fmax
            return Aii_b16_760[end]::T
        else
            return itp_b16_760_reg(log(f / fmin) / Δlnf + 1.0)::T
        end
    end
end


