"""
	unit_generic_amplification()

Function used to represent null impedance effects. Use this function to represent site effects when no amplification is desired. Returns unity.

# Examples
```julia-repl
	Af = unit_generic_amplification()
	# Af will equal 1.0
```
"""
function unit_generic_amplification()
    return 1.0
end


"""
	site_amplification(f::Real, amp_model::Symbol)

Computes the site amplification (impedance) for a given frequency `f`. Requires the keyword argument `amp_model` as a `String` and defaults to the Boore (2016) model. Currently, any other string passed to the function will return the unit amplification

# Examples
```julia-repl
	f = 5.0
	# returns the amplification from AlAtik (2021) in both cases
	Af = site_amplification(f)
    Af = site_amplification(f; amp_model=:AlAtik2021_cy14_760)
    # returns the Boore (2016) amplification
	Af = site_amplification(f; amp_model=:Boore2016)
	# returns 1.0
	Af = site_amplification(f; amp_model=:Unit)
```
"""
function site_amplification(f::T, model::Symbol; fmin=fii_min_freq, fmax=fii_max_freq, Δlnf=Δlnf_reg) where {T<:Real}
    if f <= fmin
        return oneunit(T)
    end
    if (model !== :Unit) | (model !== :Boore2016)
        f_scaled = log(f / fmin) / Δlnf + 1.0
    end
    if model == :Unit
        return unit_generic_amplification() * oneunit(T)
    elseif model == :Boore2016
        return boore_2016_generic_amplification(f)
    elseif model == :AlAtik2021_ask14_620
        if f >= fmax
            return Aii_aa21_ask14_620[end]::T
        end
        return itp_aa21_ask14_620_reg(f_scaled)::T
    elseif model == :AlAtik2021_ask14_760
        if f >= fmax
            return Aii_aa21_ask14_760[end]::T
        end
        return itp_aa21_ask14_760_reg(f_scaled)::T
    elseif model == :AlAtik2021_ask14_1100
        if f >= fmax
            return Aii_aa21_ask14_1100[end]::T
        end
        return itp_aa21_ask14_1100_reg(f_scaled)::T
    elseif model == :AlAtik2021_bssa14_620
        if f >= fmax
            return Aii_aa21_bssa14_620[end]::T
        end
        return itp_aa21_bssa14_620_reg(f_scaled)::T
    elseif model == :AlAtik2021_bssa14_760
        if f >= fmax
            return Aii_aa21_bssa14_760[end]::T
        end
        return itp_aa21_bssa14_760_reg(f_scaled)::T
    elseif model == :AlAtik2021_bssa14_1100
        if f >= fmax
            return Aii_aa21_bssa14_1100[end]::T
        end
        return itp_aa21_bssa14_1100_reg(f_scaled)::T
    elseif model == :AlAtik2021_cb14_620
        if f >= fmax
            return Aii_aa21_cb14_620[end]::T
        end
        return itp_aa21_cb14_620_reg(f_scaled)::T
    elseif model == :AlAtik2021_cb14_760
        if f >= fmax
            return Aii_aa21_cb14_760[end]::T
        end
        return itp_aa21_cb14_760_reg(f_scaled)::T
    elseif model == :AlAtik2021_cb14_1100
        if f >= fmax
            return Aii_aa21_cb14_1100[end]::T
        end
        return itp_aa21_cb14_1100_reg(f_scaled)::T
    elseif model == :AlAtik2021_cy14_620
        if f >= fmax
            return Aii_aa21_cy14_620[end]::T
        end
        return itp_aa21_cy14_620_reg(f_scaled)::T
    elseif model == :AlAtik2021_cy14_760
        if f >= fmax
            return Aii_aa21_cy14_760[end]::T
        end
        return itp_aa21_cy14_760_reg(f_scaled)::T
    elseif model == :AlAtik2021_cy14_1100
        if f >= fmax
            return Aii_aa21_cy14_1100[end]::T
        end
        return itp_aa21_cy14_1100_reg(f_scaled)::T
    else
        return T(NaN)
    end
end


"""
	site_amplification(f, site::SiteParameters)

Computes the site amplification (impedance) for a given frequency `f`.
"""
site_amplification(f, site::SiteParameters) = site_amplification(f, site.model)

"""
	site_amplification(f, fas::FourierParameters)

Computes the site amplification (impedance) for a given frequency `f`.
"""
site_amplification(f, fas::FourierParameters) = site_amplification(f, fas.site)


"""
    kappa_filter(f, site::SiteParameters)

Kappa filter for a given frequency `f`
"""
function kappa_filter(f, site::SiteParameters)
    if isnan(site.κ0)
        # Eq. 20 of Haendel et al. (2020) (frequency dependent kappa)
        # specified for a reference frequency of f0=1 Hz
        return exp(-π * site.ζ0 * (1.0 - site.η) * f^(1.0 - site.η))
    else
        return exp(-π * f * site.κ0)
    end
end
